import React, {createContext} from "react";

import {ApiContext, ApiProvider} from "./ApiProvider";

function App() {

  const data = createContext(ApiContext);
  console.log(data);

  return (
  <ApiProvider>
    <div className="input-container">
      <h1>メインテキスト</h1>
      <p>サブテキスト</p>
      <input type="text" placeholder="メインテキストを入力してください" />
      <input type="text" placeholder={data} />
      <input type="submit" value="送信"></input>
    </div>
  </ApiProvider>
  );

};

export default App;
